"use strict";(self.webpackChunkcode_docs=self.webpackChunkcode_docs||[]).push([[1477],{10:o=>{o.exports=JSON.parse('{"blogPosts":[{"id":"Docusaurus code block tabs","metadata":{"permalink":"/blog/Docusaurus code block tabs","editUrl":"https://github.com/vdwstoffel/code_docs/blob/main/blog/Using-docusaurus-code-block-tabs.md","source":"@site/blog/Using-docusaurus-code-block-tabs.md","title":"Docusaurus code block tabs","description":"Adding Code Block tabs to Docusaurus .md files","date":"2023-11-14T16:55:25.000Z","formattedDate":"November 14, 2023","tags":[{"label":"docusaurus","permalink":"/blog/tags/docusaurus"},{"label":"code_blocks","permalink":"/blog/tags/code-blocks"}],"readingTime":0.55,"hasTruncateMarker":false,"authors":[{"name":"Christoff van der Walt","title":"Author","url":"https://github.com/vdwstoffel","image_url":"https://avatars.githubusercontent.com/u/86371768?s=400&v=4","imageURL":"https://avatars.githubusercontent.com/u/86371768?s=400&v=4"}],"frontMatter":{"slug":"Docusaurus code block tabs","title":"Docusaurus code block tabs","authors":{"name":"Christoff van der Walt","title":"Author","url":"https://github.com/vdwstoffel","image_url":"https://avatars.githubusercontent.com/u/86371768?s=400&v=4","imageURL":"https://avatars.githubusercontent.com/u/86371768?s=400&v=4"},"tags":["docusaurus","code_blocks"]},"nextItem":{"title":"MongoDB","permalink":"/blog/MongoDB"}},"content":"import CodeBlock from \\"@theme/CodeBlock\\";\\nimport Tabs from \\"@theme/Tabs\\";\\nimport TabItem from \\"@theme/TabItem\\";\\n\\n## Adding Code Block tabs to Docusaurus .md files\\n\\nAs early as possible import the relevant imports\\n\\n```md\\nimport CodeBlock from \\"@theme/CodeBlock\\";\\nimport Tabs from \\"@theme/Tabs\\";\\nimport TabItem from \\"@theme/TabItem\\";\\n```\\n\\nThen you need to wrap all the code blocks in a Tab and Tabitems. Notice how the middle closes one tabitem and opens another\\n\\n````md\\n```mdx-code-block\\n<Tabs>\\n<TabItem value=\\"python.py\\">\\n```\\n\\nCODE SNIPPET\\n\\n```mdx-code-block\\n</TabItem>\\n<TabItem value=\\"javascript.js\\">\\n```\\n\\nCODE SNIPPET\\n\\n```mdx-code-block\\n</TabItem>\\n</Tabs>\\n```\\n````\\n\\n---\\n\\n```mdx-code-block\\n<Tabs>\\n<TabItem value=\\"python.py\\">\\n```\\n\\n```python\\nprint(\\"Hello World\\")\\n```\\n\\n```mdx-code-block\\n</TabItem>\\n<TabItem value=\\"javascript.js\\">\\n```\\n\\n```js\\nconsole.log(\\"Hello World\\");\\n```\\n\\n```mdx-code-block\\n</TabItem>\\n</Tabs>\\n```"},{"id":"MongoDB","metadata":{"permalink":"/blog/MongoDB","editUrl":"https://github.com/vdwstoffel/code_docs/blob/main/blog/mongodb.md","source":"@site/blog/mongodb.md","title":"MongoDB","description":"Installing MongoDB","date":"2023-11-14T16:55:25.000Z","formattedDate":"November 14, 2023","tags":[{"label":"linux","permalink":"/blog/tags/linux"},{"label":"mongodb","permalink":"/blog/tags/mongodb"},{"label":"database","permalink":"/blog/tags/database"}],"readingTime":1.105,"hasTruncateMarker":false,"authors":[{"name":"Christoff van der Walt","title":"Author","url":"https://github.com/vdwstoffel","image_url":"https://avatars.githubusercontent.com/u/86371768?s=400&v=4","imageURL":"https://avatars.githubusercontent.com/u/86371768?s=400&v=4"}],"frontMatter":{"slug":"MongoDB","title":"MongoDB","authors":{"name":"Christoff van der Walt","title":"Author","url":"https://github.com/vdwstoffel","image_url":"https://avatars.githubusercontent.com/u/86371768?s=400&v=4","imageURL":"https://avatars.githubusercontent.com/u/86371768?s=400&v=4"},"tags":["linux","mongodb","database"]},"prevItem":{"title":"Docusaurus code block tabs","permalink":"/blog/Docusaurus code block tabs"}},"content":"## Installing MongoDB\\n\\nRead more https://www.mongodb.com/docs/manual/tutorial/install-mongodb-on-ubuntu/\\n\\nImport the public key used by the package management system\\n\\n```bash\\nsudo apt-get install gnupg curl\\n```\\n\\nIssue the following command to import the MongoDB public GPG Key from https://pgp.mongodb.com/server-6.0.asc\\n\\n```bash\\ncurl -fsSL https://pgp.mongodb.com/server-6.0.asc | \\\\\\nsudo gpg -o /usr/share/keyrings/mongodb-server-6.0.gpg \\\\\\n--dearmor\\n```\\n\\nCreate a list file for MongoDB. Ubuntu 22.04\\n\\n```bash\\necho \\"deb [ arch=amd64,arm64 signed-by=/usr/share/keyrings/mongodb-server-6.0.gpg ] https://repo.mongodb.org/apt/ubuntu jammy/mongodb-org/6.0 multiverse\\" | sudo tee /etc/apt/sources.list.d/mongodb-org-6.0.list\\n```\\n\\nReload local package database\\n\\n```bash\\nsudo apt-get update\\n```\\n\\nInstall the MongoDB packages\\n\\n```bash\\nsudo apt-get install -y mongodb-org\\n\\necho \\"mongodb-org hold\\" | sudo dpkg --set-selections\\necho \\"mongodb-org-database hold\\" | sudo dpkg --set-selections\\necho \\"mongodb-org-server hold\\" | sudo dpkg --set-selections\\necho \\"mongodb-mongosh hold\\" | sudo dpkg --set-selections\\necho \\"mongodb-org-mongos hold\\" | sudo dpkg --set-selections\\necho \\"mongodb-org-tools hold\\" | sudo dpkg --set-selections\\n```\\n\\n## Using MongoDB\\n\\n[MongoDB Install Docs](https://www.mongodb.com/docs/manual/tutorial/install-mongodb-on-ubuntu/)\\n\\nStarting mongo service\\n\\n```bash\\n# Start MongoDB\\nsudo systemctl start mongod\\n\\n# Verify that MongoDB has started successfully\\nsudo systemctl status mongod\\n\\n# Stop MongoDB.\\nsudo systemctl stop mongod\\n\\n# Restart MongoDB\\nsudo systemctl restart mongod\\n```\\n\\nUsing mongo\\n\\n```bash\\n# open mondodb terminal\\nmongosh\\n\\n# Show all databases\\nshow dbs\\n\\n# Create new database\\nuse <database_name>\\n# before you can see the database you have to add a record to it\\n\\n# insert\\n> db.user.insert({name: \'Ada Lovelace\', age: 205})\\n```"}]}')}}]);